    "NOVICE",
    "CLASS A",
    "CLASS B",
    "CLASS C",
    "CLASS D",
    "CANDIDATE MASTER",
    "GRAND MASTER",
  ];

  //   const nyoba = opponents.filter((e) => e.level === levels[6]);

  //   console.log(nyoba);
  return (
    <div className="d-flex justify-content-between">
      {levels.map((e, i) => {
        return (
          <Link
            className="candidate"
            to=""
            style={e == "GRAND MASTER" ? { background: "orange" } : {}}
            onClick={(item) => {
              item.preventDefault();
            }}
          >
            {e}
          </Link>
        );
        console.log(e);
        // console.log(i);
      })}
    </div>
  );
};

export default level;
